import logo from './logo.svg';
import './App.css';
import React from 'react'
import {useState} from 'react'
/* import Box from '@mui/material/Box'; */
/* import Button from '@mui/material/Button'; */
/*import TextField from '@material-ui/core/TextField';*/
/*import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';*/
/*<TextField id="standardtextfield" label="Enter qty" variant="standard" />*/
/*
<form noValidate autoComplete = "off">
        <TextField
        label = "Enter qty"
        />
      </form>
*/

/* Implemented at least 2 components other than the Projects component in Selection and Button*/

/*
function Selection(props){
  const [initNum, setNum] = useState('');
  handleNum() {
    console.log(setNum);
  }
  return(
    <header> 
      <form>
        <label> 
          {props.title}: <input type = "number" placeholder = {props.title} onChange = {handleNum}/>
        </label>
      </form>
    </header>
  )
}
*/
/* Reused Selection component multiple times within the Projects component to further modularize the project*/
function Selection(props){
  return(
    <header> 
      <form>
        <label> 
          <input type = "number" placeholder = {props.title}/>
        </label>
      </form>
    </header>
  )
}

/* Reused Button component multiple times within the Projects component to further modularize the project*/
/* Used component Button to have custom event handler to change name of button from Join to Leave */
function Button(){
  const [btnName, setName] = useState(false);
  return (
    <button onClick={() => setName(!btnName)} style = {{backgroundColor:  'orange'}}>
      {`${btnName ? 'Leave' : 'Join'}`}
    </button>
  );  
}

/*
function HardwareSet(props){
  //Store Capacity
  //Store Availability
  //Get Value From TextField Input
  //Make sure it is integer
  //Else, default to 0
  //Subtract inputted value from availability
  //If more than availability, make availability 0
  //If adding more than capacity, make availability capacity
  //Do not change after that (no need to issue statements)
}
*/

/* Passed props from parent to child twice (App passed props to Projects and Projects passed props to Selection)*/
/* Also passed props from parent to child again when Projects passed props to Button */
function Projects(props) {
  return (
    <header> 
      <h1>Hello {props.name}! This is the project catalog:</h1>
      <h3 classname = 'newheader'>Project {props.number/3} <Button/></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*2/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3 classname = 'newheader'>Project {props.number*2/3} <Button/></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number*3/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*4/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3 classname = 'newheader'>Project {props.number*3/3} <Button/></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number*5/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*6/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
    </header>
  )
}

/* Passed props from parent to child twice (App passed props to Projects and Projects passed props to Selection)*/
class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Projects name = 'User' title = 'Enter Qty' number = {3} initsize = {100}/>
        </header>
      </div>
    );
  }
}

export default App;
